import React from "react";
import {
  ScrollView,
  View,
  RefreshControl,
} from "../../../../marslab-library-react-native/components/atoms";
import { Header } from "../../../../marslab-library-react-native/components/molecules";
import { RouteList } from "../../../../marslab-library-react-native/components/organisms";
import styles from "./styles";
import Colors from "../../../../settings/styles/theme";

const RouteGroupList = ({
  title,
  subtitle,
  subtitle2,
  subtitle3,
  data,
  onRouteMapPress,
  onRankingPress,
  readLoading
}) => {
  return (
    <ScrollView>
      <View>
        <Header
          title={title}
          subtitle={subtitle}
          iconName="md-trophy"
          iconColor="#f18a22"
          iconSize={18}
          onPress={onRankingPress}
        />
      </View>
      <View>
        <RouteList
          data={data}
          style={styles}
          subTitle1={subtitle2}
          subTitle2={subtitle3}
          onRouteMapPress={onRouteMapPress}
          readLoading={readLoading}
        />
      </View>
    </ScrollView>
  );
};

export { RouteGroupList };
